echo('python support from https://pyodide.org/en/stable/ ');
//load sympy
await box.loadpy('sympy');
sympy=box.importpy('sympy');

let sx=sympy.sympify('Eq(s(t).diff(t),s(t))');
let out=sympy.dsolve(sx,sympy.sympify('s(t)'))
echo('Solve 1st order ODE');
box.latex('solve '+sympy.latex(sx));
echo();
latex(sympy.latex(out))

